  input: TEXT,F3XA,,"Mr. Morse,  The Alaska Democratic Party is in receipt of your
    letter regarding the committee's 2003 Mid-Year report.  Please note that no employee
    of the committee spent more than 25% of their time in any given month working
    on any Federal Election Activity or activities in connection with a Federal Election.  All
    salary payments were made directly from a federal account.  As we had no declared
    federal candidate, we reimbursed our federal account with non-federal funds.  In
    July 2003, we had a candidate declare and as per the law, we will no longer take
    the split and pay the Executive Director salary out of the federal account.  I
    hope this clears this up.  Please contact us if we can be of further assistance.  Joelle
    Hall, Treasurer"
